const Sresult = () => {
const img = `https://source.unsplash.com/random/420x580/?wallpaper,landscape`

  return (
      <>
    <div className='Sresult'>
    <img src={img} alt="random"/>

    </div>
    </>
  )
}

export default Sresult;
